import React from 'react'

function Contactcard(props){
    console.log(props)
    return(
        <div>        
            <h3>Question: {props.joke.question}</h3>
    <h3>Punchline: {props.joke.punchline}</h3>
        </div>

    )
}



export default Contactcard
